import React, {useEffect} from 'react'
import './styles/App.css';
import Modal from "./Modals/Modal"
import MainHeader from "./Components/Visuals/MainHeader/MainHeader";
import MainSlide from "./Components/Visuals/MainSlide/MainSlide";

function App() {
    const [items, setItems] = React.useState([])

    useEffect(() => {
        fetch("http://localhost:8080/prometheus/fxspot/getAll")
            .then(response => response.json())
            .then(data => setItems(data));
    }, []);

    const listItems = items.map((d) =>
        <ul className="list-group listItems">
            <li className="list-group-item" key={d.id}>
                {d.id} {d.name} {d.spotRate}</li>
        </ul>);

    return (

        <div className="wrapper">

            <div className="sidebar">
                <div>
                    <MainHeader/> &nbsp;
                    <button className="btn btn-primary">
                        Start!
                    </button>
                    &nbsp;
                    <Modal items={listItems}/>

                </div>
            </div>
            <MainSlide/>
            {/*<div className="mainSlide">*/}
            {/*    <div className="bg">*/}

            {/*    </div>*/}
            {/*</div>*/}

        </div>
    );
}

export default App;
